import React, { Component } from 'react'

export default class SidePanel extends Component {
    render() {
        return (
            <nav className="nav flex-column float-lg-right float-md-right float-xl-right">
                <a className="nav-link active" href="google.com">Noticias</a>
                <a className="nav-link" href="google.com">Mensajería</a>
                <a className="nav-link" href="google.com">Marketplace</a>
                
                <a className="nav-link active" href="google.com">Grupos</a>
                <a className="nav-link" href="google.com">Páginas</a>
                <a className="nav-link" href="google.com">Eventos</a>                
                <a className="nav-link" href="google.com">Guardado</a>
            </nav>
        )
    }
}
